#stop - left - down
def outputToList(list,listName):
    print (f'{listName} = [',end='')
    for i in list:
        print(f'{i},',end=' ')
    print(']')    
    print()

def generateLabelList(counterList,targetNode):
    outputList = []
    nameList = ['"stop"','"left"','"down"']
    listName = targetNode+"Label"
    for i in range(counterList[0]):
        outputList.append(nameList[0])

    for i in range(counterList[1]):
        outputList.append(nameList[1])

    for i in range(counterList[2]):
        outputList.append(nameList[2])
    print (f'{listName} = [',end='')
    for i in outputList:
        print(f'{i},',end=' ')
    print(']')    
    print()
    #print(counterList)

def getData(targetNode):
    listName = targetNode+'Data'
    tempList = []
    outputList = []
    counterList = []
    stopCounter = 0
    leftCounter = 0
    downCounter = 0
    for i in stopList:
        if(i[0] == targetNode):
            stopCounter = stopCounter + 1
            tempList.append(i[1])
            tempList.append(i[2])
            outputList.append(tempList)
            tempList = []
    counterList.append(stopCounter)

    for i in leftList:
        if(i[0] == targetNode):
            leftCounter = leftCounter + 1
            tempList.append(i[1])
            tempList.append(i[2])
            outputList.append(tempList)
            tempList = []
    counterList.append(leftCounter)

    for i in downList:
        if(i[0] == targetNode):
            downCounter = downCounter + 1
            tempList.append(i[1])
            tempList.append(i[2])
            outputList.append(tempList)
            tempList = []
    counterList.append(downCounter)

    outputToList(outputList,listName)

    generateLabelList(counterList,targetNode)

#main
for i in range(1,21):
    getData(f'left{i}')
for i in range(1,21):
    getData(f'right{i}')
